      SELECT ALL + col0 / col1 + + - 16 - + + col2 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT BETWEEN + col1 + + + col1 AND + col2;
  - name: tab2

outputs:
  - name: q7401.out
    data: |
